import React from 'react';

import classes from './Modelos.module.css';

const Modelos = (props) => {

    const form = props.modelos.map((modelo, i)=>(
        <label>{modelo.tipo} <span>${modelo.precio.toFixed(2)}</span>
        <input type="checkbox" checked={modelo.select}/>
        </label>
    ))
    return ( 
        <div className={classes.Modelos}>
            <h2>Elija el modelo</h2>
            <form>
            {form}
            </form>
        </div>
     );
}
 
export default Modelos;
